import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";

import { Button, Navbar, Container, Nav, Row, Col } from "react-bootstrap";

let Title = styled.div`
  font-size: 2rem;
  padding: 0.5rem;
  text-align: center;
  background-color: grey;
  border-radius: 1rem;
  width: 50%;
  color: darkgrey;
  box-shadow: 0.2rem 0.2rem 0.2rem 0.2rem black;
`;
let CenterBox = styled.div`
  text-align: center;
`;

let MainWrap = styled.div`
  max-width: 1300px;
  margin: auto;
  background: #00457e;
  padding: 1rem;
`;

let Navbars = styled.div`
  text-align: center;
  background: #02315e;
  color: white;
  padding: 1rem;
  font-size: 2rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let Searchbox = styled.div`
  text-align: center;
  background: #806491;
  color: white;
  padding: 0.5rem;
  border-radius: 1rem;
  margin: 1rem;
  font-size: 1.5rem;
  border: none;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 64rem;
  margin-top: 3rem;
  margin-bottom: 3rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let LoginBtn = styled.button`
  text-align: center;
  color: white;
  border-radius: 1rem;
  padding: 0.8rem;
  background: #2f70af;
  float: left;
  font-size: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
  border: none;
`;

let Feeds = styled.div`
  border-radius: 1rem;
  background: #02315e;
  color: white;
  padding: 0.5rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let Contents = styled.div`
  background: #00457e;
  margin: 2rem;
  border-radius: 1rem;
  padding: 2rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let PlayerBox = styled.div`
  border-radius: 1rem;
  background: #b9848c;
  color: white;
  padding: 0.5rem;
  margin-top: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let ContollerBtn = styled.button`
  margin-top: 1rem;
  border-radius: 10rem;
  background: #806491;
  margin-left: 0.5rem;
  margin-right: 1rem;
  border: none;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let MusicBar = styled.div`
  width: 50rem;
  margin: auto;
  margin-top: 1rem;
  margin-bottom: 1rem;
  height: 3rem;
`;
let MusicBar1 = styled.div`
  background: white;
  width: 50rem;
  height: 0.5rem;
  margin: auto;
  margin-top: 3rem;
  margin-bottom: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;
let MusicBar2 = styled.div`
  background: red;
  width: 30rem;
  height: 0.5rem;
`;
let LoginBox = styled.div`
  background: #02315e;
  border-radius: 1rem;
  padding: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
  float: right;
  color: white;
  margin-top: 1rem;
`;
let InputBox = styled.div`
  background: white;
  color: black;
  margin: 0.2rem;
  width: 10rem;
`;

let TimeLeft = styled.div`
  float: left;
  margin-top: 2rem;
`;
let TimeRight = styled.div`
  float: Right;
  margin-top: 2rem;
`;

let HashTag = styled.div``;
let MusicTitle = styled.div`
  font-size: 1.5rem;
`;

function App() {
  return (
    <MainWrap className="App">
      <Navbars>
        <LoginBtn>Menu</LoginBtn>
        SNS Music
        {/* <LoginBtn>로그인</LoginBtn> */}
      </Navbars>
      <LoginBox>
        로그인<InputBox>아이디</InputBox>
        <InputBox>비밀번호</InputBox>
      </LoginBox>
      <CenterBox>
        <Searchbox>#검색</Searchbox>
      </CenterBox>

      <Feeds>
        <Contents>
          제목 : 블랙핑크 노래 좋습니다.<HashTag>#블랙핑크</HashTag>
          블랙핑크 노래가 아주 좋습니다.
        </Contents>
        <Contents>
          제목 : 블랙핑크 노래 좋습니다.<HashTag>#블랙핑크</HashTag>
          블랙핑크 노래가 아주 좋습니다.
        </Contents>
        <Contents>
          제목 : 블랙핑크 노래 좋습니다.<HashTag>#블랙핑크</HashTag>
          블랙핑크 노래가 아주 좋습니다.
        </Contents>
      </Feeds>

      <PlayerBox>
        <CenterBox>
          <MusicBar>
            <MusicTitle>노래제목</MusicTitle>
            <ContollerBtn> ◁◁ </ContollerBtn>
            <ContollerBtn> ▶ </ContollerBtn>
            <ContollerBtn> ▷▷ </ContollerBtn>
            <TimeLeft>2:01</TimeLeft>
            <TimeRight>3:05</TimeRight>
          </MusicBar>
        </CenterBox>
        <CenterBox>
          <MusicBar>
            <MusicBar1>
              <MusicBar2></MusicBar2>
            </MusicBar1>
          </MusicBar>
        </CenterBox>
      </PlayerBox>
    </MainWrap>
  );
}

export default App;
